import React from 'react'
import TableData from './TableData'

function TableRow({ userContact }) {
    return (
        <tr>
            {userContact.filter((contactItem) => {
                return () => {
                    if (
                        contactItem !== 'userId' &&
                        contactItem !== 'contactId' &&
                        contactItem !== 'profile'
                    ) {
                        return <TableData></TableData>
                    }
                }
            })}
        </tr>
    )
}
export default TableRow
